import { Link } from 'react-router-dom';
import './CartPage.css';


class Checkout extends React.Component {
  render() {
    const storage = JSON.parse(localStorage.getItem('cart'))
    return (
      <div>
      {storage.map(e => 
      <span>{e.title}</span>
      )}
      </div>
    );
  }
}

export default Checkout;
